import React from 'react';
import { Box } from '../components/Box';
import { Text } from '../components/Text';

function Home() {
  return (
    <Box>
      <Box
        css={{
          padding: '$5 $6',
          display: 'grid',
          gap: '$3',
          gridTemplateColumns: 'repeat(9, 60px)',
          gridTemplateRows: 'repeat(9, 60px)',
          // gridAutoRows: '60px',
          alignItems: 'baseline',
          textAlign: 'center',
        }}
      >
        <Text size="9">H</Text>
        <Text size="8">e</Text>
        <Text size="7">l</Text>
        <Text size="6">l</Text>
        <Text size="4">p</Text>
        <Text size="3">B</Text>
        <Text size="2">y</Text>
        <Text size="1">r</Text>
        <Text size="1">d</Text>
      </Box>
      <Box
        css={{
          padding: '$5 $6',
          display: 'flex',
          flexDirection: 'column',
          gap: '$3',
        }}
      >
        <Text size="5" weight="regular">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="medium">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="semibold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="bold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
      </Box>
    </Box>
  );
}

export default Home;
